import React, { useState, useEffect } from "react";

// index import
import man from "../assests/man.png";
import background_img from "../assests/background.jpg";

import design from "../assests/icons/design.png"

function Navbar() {
  // State variables for background color and padding top
  const [bgColor, setBgColor] = useState("transparent");

  // useEffect to handle scroll event and update background color and padding top
  useEffect(() => {
    const handleScroll = () => {
      // Change background color and padding top based on scroll position
      if (window.scrollY > 100) {
        setBgColor("#0e0e0e");
      } else {
        setBgColor("transparent");
      }
    };

    // Add event listener when component mounts
    window.addEventListener("scroll", handleScroll);

    // Remove event listener when component unmounts
    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  // useEffect to save background color and padding top to localStorage
  useEffect(() => {
    localStorage.setItem("bgColor", bgColor);
  }, [bgColor]);

  return (
    <>
      <nav
        class="fixed  md:py-2 w-[-webkit-fill-available] "
        style={{
          backgroundColor: bgColor,
          transition: "background-color 0.3s, padding-top 0.3s",
        }}
      >
        <div className="flex flex-col  sm:flex-row sm:mx-10 lg:mx-40 text-center justify-between">
          <a
            href=""
            className="baloo-paaji text-white py-4 text-3xl font-medium"
          >
            MohitJi
          </a>
          <div className=" flex text-center px-2 mb-5  bg-[#ffffff2e]  rounded-3xl  py-1.5 sm:align-middle sm:m-auto font-normal  text-gray-700 justify-center text-sm  ">
            <a
              href=""
              class="mx-1.5 text-white rounded-2xl px-3 sm:px-5 py-1.5 hover:bg-gray-100 hover:text-black"
            >
              HOME
            </a>
            <a
              href=""
              class="mx-1.5 text-white rounded-2xl px-3 sm:px-5 py-1.5 hover:bg-gray-100 hover:text-black"
            >
              PROJECTS
            </a>
            <a
              href=""
              class="mx-1.5 text-white rounded-2xl px-3 sm:px-5 py-1.5 hover:bg-gray-100 hover:text-black"
            >
              RESUME
            </a>
            <a
              href=""
              class="mx-1.5 text-white rounded-2xl px-3 sm:px-5 py-1.5 hover:bg-gray-100 hover:text-black"
            >
              ABOUT ME
            </a>
          </div>
          <div className="flex">
            <button className="hidden sm:block text-sm  text-white border-[#ffffff7c] hover:bg-white hover:text-black border px-5 py-1.5 rounded m-auto ">
              CONTACT ME
            </button>
          </div>
        </div>
      </nav>

      <main className="min-h-[550vh] bg-gray-100 ">
        <section className=" min-h-[100vh] IndexHeaderBackground flex">
          <div className="m-auto text-center">
            <h2 className="text-gray-400 mb-3 md:text-5xl text-4xl">
              HI, I AM MOHIT
            </h2>
            <div className="">
              <h3 className="text-gray-300 md:text-[7rem] text-6xl font-bold md:leading-[5.8rem] font-mono francois-one-regular">
                Full Stack Web{" "}
              </h3>
              <h3 className="text-gray-300 md:text-[7rem] text-6xl font-bold md:leading-[5.8rem] font-mono francois-one-regular">
                Developer
              </h3>
            </div>
            <p className="text-gray-400 md:text-lg py-8">
              Let's turn your visionary concepts into digital wonders, crafting
              each <br /> element with expertise and care.
            </p>
            <button className="text-white  outline outline-offset-8 outline-white rounded-3xl hover:bg-gray-300 hover:text-black bg-[#ffffff2e] md:px-20 px-16 py-2 ">
              {" "}
              Let's Talk
            </button>
          </div>
        </section>
        <section className="flex container px-52 my-20">
          {/* <img src={man} className="w-56 h-auto" alt="" /> */}
          <div className="text-3xl">
            <div className="w-52 px-16  py-10 hover:shadow-xl border-2 rounded-xl my-3  "> <img src={design} alt="img" className="scale-90" /> Let's Design</div>
            <div className="w-52 px-16  py-10 hover:shadow-xl border-2 rounded-xl my-3  "> Let's Build</div>
            <div className="w-52 px-16  py-10 hover:shadow-xl border-2 rounded-xl my-3  "> Let's deploy</div>

          </div>
          <div className="mx-8">
            <h3 className="text-5xl font-semibold">What do I help?</h3>
            <p className="text-2xl text-gray-700 leading-10 my-10 ">
              I'm here to assist you in finding solutions and resolving your
              web-related challenges effectively. Utilizing process design, I
              specialize in crafting digital products tailored to your needs.{" "}
              <br /> <br />
              Moreover, I offer support in enhancing your online presence and
              business operations, ensuring comprehensive assistance for your
              success in the digital realm.
            </p>
          </div>
        </section>
      </main>
    </>
  );
}
export default Navbar;
